import React from "react";

const ContactItem = ({ contact }) => {
  const { name, phone, email, type } = contact;
  return (
    <div>
      <div class="card">
        <img src="img_avatar.png" alt="Avatar" style="width:100%" />
        <div class="container">
          <h4>
            <b>John Doe</b>
          </h4>
          <p>Architect & Engineer</p>
        </div>
      </div>

      <h2>{type}</h2>
      <h3>{name}</h3>
      <h5>{phone}</h5>
      <h5>{email}</h5>
    </div>
  );
};

export default ContactItem;
